  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Section 4523 of the Balanced Budget Act
  of 1997 (BBA) provides authority for CMS to implement a prospective payment system
  (PPS) under Medicare for hospital outpatient services, certain Part B services furnished
  to hospital inpatients who have no Part A coverage, and partial hospitalization
  services furnished by community mental health centers. The provisions of this section
  were further modified by sections 201 and 202 of the Balanced Budget Refinement
  Act of 1999 (BBRA).</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
